/**
 * Restaurant listing component
 * 
 * Author: Ryan Riddiford
 * Student ID: 20862086
 */


//Import dependencies
import { LitElement, html, css } from '@polymer/lit-element';
import {anchorRoute, gotoRoute} from '../../Router';
import Auth from '../../services/AuthAPI';
import App from '../../App';
import uiUtils from '../../utils/ui.utils';
import enumUtils from '../../utils/enum.utils';


//Define the header element as a custom element
customElements.define('restaurant-listing', class RestaurantListing extends LitElement {


  constructor(){
    super();   
  }


  //Configure the element's custom properties
  static get properties(){
    return {
      restaurant: {
        type: Object
      },
    }
  }


  firstUpdated(){
    console.log("ding ding");
    super.firstUpdated();  
  }




  render(){  


    console.log("rendering restaurant");
    console.log(this.restaurant);


    let viewBtn = uiUtils.createButtonElement(enumUtils.buttonElType.sl, "view-btn", "","button","View Restaurant", false);
  viewBtn.setAttribute("restaurantId", this.restaurant._id);
  viewBtn.setAttribute("restaurantName", this.restaurant.restaurantName);
  viewBtn.addEventListener("click", (event) => {
  
  localStorage.setItem("restaurantId", event.target.getAttribute("restaurantId"));
  localStorage.setItem("restaurantName", event.target.getAttribute("restaurantName"));
  
  gotoRoute('/restaurant', event.target.getAttribute("restaurantId"));
  });


return html`

<style>

.restaurant-listing {
  display:flex;
  flex-direction: row;
  width:100%;
  justify-content: space-evenly;
}

.restaurant-listing left, .restaurant-listing mid, .restaurant-listing right {
  display:flex;
  flex-direction: column;
}

</style>



<div class="restaurant-listing">
  <div class="left">
<h3>${JSON.stringify(this.restaurant.location)}</h3>
  </div>
  <div class="mid">
  ${JSON.stringify(this.restaurant.location)}  
</div>
<div class="right">
    ${viewBtn}
</div>
</div>
`;

  }


})
